            </Grid>
            <Grid item display="flex" justifyContent="center" alignItems="center">
                <Button variant="outlined" color="error" onClick={() => {
                    navigate('/')
                }}>TORNA AL LOGIN</Button>
            </Grid>
        </Grid>
    );
}

export default Error;
